/* FIREBASE DEPENDENCY */

const SignUp = () => {
    return (
        <div class = "bodyContent">
          <div class = "signUpFrame">
              <h2>Create an account</h2>
              <div id = "fname" class = "fieldFrame">
                <h4>First name</h4>
                <input id = "fname"/>
              </div>
              <div id = "lname" class = "fieldFrame">
                <h4>Last name</h4>
                <input id = "lnameEntry"/>
              </div>
              <div id = "email" class = "fieldFrame">
                  <h4>Email</h4>
                  <input id = "email"/>
              </div>
              <div id = "password" class = "fieldFrame">
